import React from "react";

const videoFeed: React.FC = () => {
  return (
    <div>
      <h3>Live Video Feed</h3>
      {/* The img tag will continuously update as it receives the JPEG stream */}
      <img 
        src="/video_feed" 
        alt="Live Video Feed" 
        style={{ width: "100%", maxWidth: "640px" }} 
      />
    </div>
  );
};

export default videoFeed;
